import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
         <h2>이것은 수정되엇음</h2>
      </header>
    </div>
  );
}

export default App;
